import React from "react";
import {
  AppBar, Toolbar, Typography, Box, Avatar, IconButton, Menu, MenuItem, Card, Divider, Button, List, ListItem, ListItemIcon, ListItemText, Drawer, Badge
} from "@mui/material";
import PersonIcon from "@mui/icons-material/Person";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import EditIcon from "@mui/icons-material/Edit";
import PhoneIphoneIcon from "@mui/icons-material/PhoneIphone";
import EmailIcon from "@mui/icons-material/Email";
import VpnKeyIcon from "@mui/icons-material/VpnKey";
import LogoutIcon from "@mui/icons-material/Logout";

const navDropdowns = [
  {label: "Masters", items: ["Vehicle Master", "Product Master"]},
  {label: "Order", items: ["Place an Order", "My Cart", "My Orders"]},
  {label: "Reports", items: ["Order History", "Wallet Reports"]},
];
const navDirect = [
  {label: "Home", link: "#"},
  {label: "Customer Service", link: "#"},
];

export default function ZomatoDashboard() {
  const [profileOpen, setProfileOpen] = React.useState(false);
  const [navAnchor, setNavAnchor] = React.useState(null);
  const [dropdownIdx, setDropdownIdx] = React.useState(-1);

  const handleDropdownOpen = (idx, event) => {
    setDropdownIdx(idx);
    setNavAnchor(event.currentTarget);
  };
  const handleDropdownClose = () => {
    setDropdownIdx(-1);
    setNavAnchor(null);
  };

  return (
    <Box>
      {/* NAVIGATION BAR */}
      <AppBar position="sticky" className="zmt-navbar">
        <Toolbar disableGutters className="zmt-navbar-inner">
          <Box display="flex" alignItems="center">
            <Avatar sx={{width: 38, height: 38, bgcolor: "#fff", color: "#e23744", fontWeight: 900}}>
              <PersonIcon fontSize="medium" />
            </Avatar>
            <span className="zmt-logo-txt" style={{marginLeft: "0.7em", fontSize: "1.46em"}}>FUELnow</span>
          </Box>
          <Box className="zmt-nav-links">
            {navDirect.map(el => (
              <Button className="zmt-nav-link" sx={{mr:1.2}} key={el.label}>
                {el.label}
              </Button>
            ))}
            {navDropdowns.map((el, idx) => (
              <Box key={el.label} sx={{position:"relative"}}>
                <Button className="zmt-nav-drop-btn"
                  aria-controls={`nav-dropdown-${idx}`}
                  aria-haspopup="true"
                  onMouseEnter={e => handleDropdownOpen(idx,e)}
                  onMouseLeave={handleDropdownClose}
                >
                  {el.label}
                  <span style={{marginLeft:6,fontWeight:400,fontSize:15}}>▼</span>
                </Button>
                <Menu
                  id={`nav-dropdown-${idx}`}
                  anchorEl={navAnchor}
                  open={dropdownIdx === idx}
                  onClose={handleDropdownClose}
                  MenuListProps={{
                    onMouseLeave: handleDropdownClose,
                  }}
                >
                  {el.items.map(i =>
                    <MenuItem key={i} onClick={handleDropdownClose}>{i}</MenuItem>
                  )}
                </Menu>
              </Box>
            ))}
          </Box>
          <Box display="flex" alignItems="center">
            <IconButton size="large" className="zmt-cart">
              <Badge badgeContent={0} color="error">
                <ShoppingCartIcon sx={{ fontSize: 22 }} />
              </Badge>
            </IconButton>
            <Avatar
              className="zmt-profile-av"
              sx={{
                width: 36,
                height: 36,
                bgcolor: "#ffd1d1",
                color: "#b71c1c",
                fontWeight: 700,
                fontSize: 21,
                ml: 1.5
              }}
              onClick={() => setProfileOpen(true)}
            >
              J
            </Avatar>
          </Box>
        </Toolbar>
      </AppBar>

      {/* PROFILE DRAWER */}
      <Drawer
        anchor="right"
        open={profileOpen}
        onClose={()=>setProfileOpen(false)}
        sx={{
          "& .MuiDrawer-paper": {
            width: 310,
            borderTopLeftRadius: 30,
            borderBottomLeftRadius: 30,
            boxShadow: 6
          }
        }}>
        <Box className="drawer-profile-header" display="flex" flexDirection="column">
          <IconButton sx={{ alignSelf: "flex-end", mt: 1.5, mr: .5 }} onClick={()=>setProfileOpen(false)}>
            <Typography variant="h5" sx={{ fontWeight: 700, color: "#222" }}>×</Typography>
          </IconButton>
          <Avatar className="drawer-profile-av"
            sx={{
              width: 76, height: 76,
              bgcolor: "#ffd1d1", color: "#b71c1c", fontWeight: 900, fontSize: 34, mb: 1.4
            }}>
            J
          </Avatar>
          <span className="drawer-profile-name">jai devarajan</span>
          <Button startIcon={<EditIcon />}
            className="profile-action-btn"
            variant="contained"
          >Edit Profile</Button>
        </Box>
        <Divider />
        <List>
          <ListItem button>
            <ListItemIcon><PhoneIphoneIcon sx={{color: "#e23744"}} /></ListItemIcon>
            <ListItemText primary="Update Mobile" />
          </ListItem>
          <ListItem button>
            <ListItemIcon><EmailIcon sx={{color: "#e23744"}} /></ListItemIcon>
            <ListItemText primary="Update Email" />
          </ListItem>
          <ListItem button>
            <ListItemIcon><VpnKeyIcon sx={{color: "#e23744"}} /></ListItemIcon>
            <ListItemText primary="Update Password" />
          </ListItem>
          <ListItem button>
            <ListItemIcon><LogoutIcon sx={{color: "#e23744"}} /></ListItemIcon>
            <ListItemText primary="Log Out" />
          </ListItem>
        </List>
      </Drawer>

      <Box className="dashboard-container">
        <Box className="dashboard-panels-row">
          <Card className="zmt-dash-card main">
            <span className="title">AVAILABLE LOYALTY</span>
            <span className="amt">₹0</span>
            <span className="desc">Available Loyalty - Blocked(In Cart, Payment Initiated)</span>
          </Card>
          <Card className="zmt-dash-card yellow">
            <span className="title">MY WALLET LIMIT</span>
            <span className="amt">₹0</span>
            <span className="desc">Amount available in your wallet</span>
          </Card>
          <Card className="zmt-dash-card orders">
            <span className="title">My Last 5 Orders</span>
            <Divider sx={{my: 1,opacity:.7}}/>
            <span className="desc">No records found</span>
          </Card>
        </Box>
        <Card className="zmt-assets-card">
          <span className="assets-title">My Assets</span>
          <Divider sx={{my: .9}}/>
          <span className="assets-content">No records found</span>
        </Card>
      </Box>
    </Box>
  );
}
